// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

contract Donor {

    mapping(uint256 => DonorData) public donorMapping;
    uint256 donorCount;
    struct DonorData {
        uint256 donorId;
        string name;
        string bloodGroup;
        uint256 mobNumber;
        uint256 age;
        string location;
    }

    function getDonorData(uint256 _donorId)
        public
        view
        returns (DonorData memory)
    {
        require(_donorId > 0, "Donor id Is invalid");
        return (donorMapping[_donorId]);
    }

    function addDonorData(
        string memory _name,
        string memory _bloodGroup,
        uint256 _mobNumber,
        uint256 _age,
        string memory _location
    ) public {
        donorMapping[donorCount].donorId = donorCount;
        donorMapping[donorCount].name = _name;
        donorMapping[donorCount].bloodGroup = _bloodGroup;
        donorMapping[donorCount].mobNumber = _mobNumber;
        donorMapping[donorCount].age = _age;
        donorMapping[donorCount].location = _location;
        // create enum
        donorCount++;
    }
}
